function App() {
  return (
    <OuterContainer>       
      <Main>
        <InnerContainer>
          <HeaderContainer>
            <Header />
            <Categories title = {data.title} img ={data.img}/>
          </HeaderContainer>
          <FoodContainer>
            <FoodList foods ={data} />
          </FoodContainer>

        </InnerContainer>        
      </Main>
    </OuterContainer>


  );
}

export default App;
